import{M as d}from"./chunks/MochaVersionTags.50399595.js";import{c as h}from"./chunks/constants.b02263eb.js";import{_ as p,o as i,c as s,k as e,t as o,H as a,Q as n,a as u}from"./chunks/framework.037666a6.js";import"./chunks/mocha_versions.7ac23927.js";const m="/docs-preview/pr-1963/img/mocha.jpg",g={name:"MochaTestnetDetails",data(){return{constants:h}}},f=e("tr",null,[e("th",null,"Detail"),e("th",null,"Value")],-1),b=e("td",null,"Chain ID",-1),w=e("tr",null,[e("td",null,"Genesis hash"),e("td",null,[e("code",null,"B93BBE20A0FBFDF955811B6420F8433904664D45DB4BF51022BE4200C1A1680D")])],-1),y=e("td",null,"Genesis file",-1),k=["href"],v=e("td",null,"Peers file",-1),C=["href"],_=e("tr",null,[e("td",null,"Validators"),e("td",null," 100 ")],-1);function P(c,l,r,E,t,x){return i(),s("table",null,[f,e("tr",null,[b,e("td",null,[e("code",null,o(t.constants.mochaChainId),1)])]),w,e("tr",null,[y,e("td",null,[e("a",{href:`https://github.com/celestiaorg/networks/blob/master/${t.constants.mochaChainId}/genesis.json`,target:"_blank",rel:"noopener noreferrer"}," https://github.com/celestiaorg/networks/blob/master/"+o(t.constants.mochaChainId)+"/genesis.json ",9,k)])]),e("tr",null,[v,e("td",null,[e("a",{href:`https://github.com/celestiaorg/networks/blob/master/${t.constants.mochaChainId}/peers.txt`,target:"_blank",rel:"noopener noreferrer"}," https://github.com/celestiaorg/networks/blob/master/"+o(t.constants.mochaChainId)+"/peers.txt ",9,C)])]),_])}const T=p(g,[["render",P]]),R=n('<h1 id="mocha-testnet" tabindex="-1">Mocha testnet <a class="header-anchor" href="#mocha-testnet" aria-label="Permalink to &quot;Mocha testnet&quot;">​</a></h1><p><img src="'+m+'" alt="mocha-testnet"></p><p>This guide contains the relevant sections for how to connect to Mocha, depending on the type of node you are running. Mocha testnet is designed to help validators test out their infrastructure and node software. Developers are encouraged to deploy their sovereign rollups on Mocha, but we also recommend <a href="/docs-preview/pr-1963/how-to-guides/arabica-devnet">Arabica devnet</a> for that as it is designed for development purposes.</p><p>Mocha is a milestone in Celestia, allowing everyone to test out core functionalities on the network. Read <a href="https://blog.celestia.org/celestia-testnet-introduces-alpha-data-availability-api" target="_blank" rel="noreferrer">the announcement</a>. Your best approach to participating is to first determine which node you would like to run. Each node&#39;s guide will link to the relevant networks, to show you how to connect to them.</p><p>You have a list of options on the types of nodes you can run to participate in Mocha:</p><p>Consensus:</p><ul><li><a href="/docs-preview/pr-1963/how-to-guides/consensus-node">Consensus node</a></li><li><a href="/docs-preview/pr-1963/how-to-guides/validator-node">Validator node</a></li></ul><p>Data Availability:</p><ul><li><a href="/docs-preview/pr-1963/how-to-guides/bridge-node">Bridge node</a></li><li><a href="/docs-preview/pr-1963/how-to-guides/full-storage-node">Full storage node</a></li><li><a href="/docs-preview/pr-1963/how-to-guides/light-node">Light node</a></li></ul><p>Select the type of node you would like to run and follow the instructions on each respective page. Whenever you are asked to select the type of network you want to connect to in those guides, select <code>Mocha</code> to refer to the correct instructions on this page on how to connect to Mocha.</p><h2 id="network-details" tabindex="-1">Network details <a class="header-anchor" href="#network-details" aria-label="Permalink to &quot;Network details&quot;">​</a></h2>',11),q=e("h2",{id:"software-version-numbers",tabindex:"-1"},[u("Software version numbers "),e("a",{class:"header-anchor",href:"#software-version-numbers","aria-label":'Permalink to "Software version numbers"'},"​")],-1),A=n('<h2 id="rpc-for-da-bridge-full-and-light-nodes" tabindex="-1">RPC for DA bridge, full, and light nodes <a class="header-anchor" href="#rpc-for-da-bridge-full-and-light-nodes" aria-label="Permalink to &quot;RPC for DA bridge, full, and light nodes&quot;">​</a></h2><h3 id="production-rpc-endpoints" tabindex="-1">Production RPC endpoints <a class="header-anchor" href="#production-rpc-endpoints" aria-label="Permalink to &quot;Production RPC endpoints&quot;">​</a></h3><p>These RPC providers are meant to be used in production environments.</p><table><thead><tr><th>Provider</th><th>URL</th></tr></thead><tbody><tr><td>Grove</td><td><a href="https://www.grove.city/" target="_blank" rel="noreferrer">https://www.grove.city/</a></td></tr><tr><td>Numia</td><td>For RPC access: <a href="https://docs.numia.xyz/infra/overview/getting-started" target="_blank" rel="noreferrer">https://docs.numia.xyz/infra/overview/getting-started</a></td></tr><tr><td>Numia</td><td>For data warehouse access: <a href="https://docs.numia.xyz/sql/querying-data/chains/celestia" target="_blank" rel="noreferrer">https://docs.numia.xyz/sql/querying-data/chains/celestia</a></td></tr><tr><td>QuickNode</td><td><a href="https://www.quicknode.com/chains/celestia" target="_blank" rel="noreferrer">https://www.quicknode.com/chains/celestia</a> (<a href="https://quicknode.com/docs/celestia" target="_blank" rel="noreferrer">docs</a>)</td></tr></tbody></table><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Do not rely on the free community endpoints listed below for production deployments. Production deployments should rely on <a href="#production-rpc-endpoints">service providers with SLAs</a> or your own node.</p></div><h3 id="community-data-availability-da-rpc-endpoints-for-bridge-node-sync" tabindex="-1">Community Data availability (DA) RPC endpoints for bridge node sync <a class="header-anchor" href="#community-data-availability-da-rpc-endpoints-for-bridge-node-sync" aria-label="Permalink to &quot;Community Data availability (DA) RPC endpoints for bridge node sync&quot;">​</a></h3><p>These RPC endpoints allow bridge nodes to sync blocks from the Celestia network. For users, they will need to provide a <code>–core.ip string</code> from a consensus node&#39;s URL or IP that populates a default RPC port at 26657 to their respective DA node.</p><h3 id="community-data-availability-da-grpc-endpoints-for-state-access" tabindex="-1">Community Data availability (DA) gRPC endpoints for state access <a class="header-anchor" href="#community-data-availability-da-grpc-endpoints-for-state-access" aria-label="Permalink to &quot;Community Data availability (DA) gRPC endpoints for state access&quot;">​</a></h3><p>These gRPC endpoints for DA nodes provide state access for querying the chain&#39;s state and broadcasting transactions (balances, blobs, etc.) to the Celestia network. For users, they will need to provide a <code>–core.ip string</code> from a consensus node&#39;s URL or IP that populates a default gRPC port at 9090 to their respective DA node.</p><div class="tip custom-block"><p class="custom-block-title">Bridge nodes</p><p>Mentioned below RPC endpoints do not guarantee you the download of full blocks from them. We advise that if you are running a bridge node, that you also run a local <a href="/docs-preview/pr-1963/how-to-guides/consensus-node">consensus node</a> in order to download full blocks from it.</p></div><ul><li><code>public-celestia-mocha4-consensus.numia.xyz</code></li><li><code>full.consensus.mocha-4.celestia-mocha.com</code></li><li><code>consensus-full-mocha-4.celestia-mocha.com</code></li><li><code>rpc-mocha.pops.one</code></li><li><code>celestia-testnet-consensus.itrocket.net</code><ul><li>RPC port: 26657</li><li>gRPC port: 9090</li></ul></li><li><code>celestia-mocha-archive-rpc.mzonder.com</code><ul><li>RPC port: 26657</li><li>gRPC port: 9090</li></ul></li></ul><h2 id="community-rpc-endpoints" tabindex="-1">Community RPC endpoints <a class="header-anchor" href="#community-rpc-endpoints" aria-label="Permalink to &quot;Community RPC endpoints&quot;">​</a></h2><p>The RPC endpoint is to allow users to interact with Celestia&#39;s nodes by querying the node&#39;s state and broadcasting transactions on the Celestia network. The default port is 26657.</p><ul><li><code>public-celestia-mocha4-consensus.numia.xyz:26657</code></li><li><code>celestia-testnet.brightlystake.com</code></li><li><code>rpc-celestia-mocha.trusted-point.com</code></li><li><code>rpc-celestia-testnet-01.stakeflow.io</code></li><li><code>mocha.celestia.rpc.cumulo.me</code></li><li><code>rpc.archive.mocha.cumulo.com.es</code></li><li><code>rpc-1.testnet.celestia.nodes.guru</code></li><li><code>rpc-2.testnet.celestia.nodes.guru</code></li><li><code>celestia-testnet-rpc.itrocket.net:443</code></li><li><code>celestia-t-rpc.noders.services</code></li><li><code>rpc-celestia-testnet.mzonder.com:443</code></li><li><code>celestia-testnet-da-archival.rpc.grove.city/v1/c33eeadb</code></li></ul><h2 id="community-api-endpoints" tabindex="-1">Community API endpoints <a class="header-anchor" href="#community-api-endpoints" aria-label="Permalink to &quot;Community API endpoints&quot;">​</a></h2><p>The API endpoint is to allow users to interact with the REST API in Cosmos SDK which is implemented using gRPC-gateway, which exposes gRPC endpoints as REST endpoints. This allows for communication with the node using REST calls, which can be useful if the client does not support gRPC or HTTP2. The default port is 1317.</p><ul><li><code>https://api-mocha.pops.one</code></li><li><code>https://api.celestia-mocha.com/</code></li><li><code>https://celestia-testnet.brightlystake.com/api</code></li><li><code>https://api-celestia-mocha.trusted-point.com</code></li><li><code>https://api-celestia-testnet-01.stakeflow.io/</code></li><li><code>https://mocha.api.cumulo.me/</code></li><li><code>https://api.archive.mocha.cumulo.com.es</code></li><li><code>https://api-1.testnet.celestia.nodes.guru</code></li><li><code>https://api-2.testnet.celestia.nodes.guru</code></li><li><code>https://celestia-testnet-api.itrocket.net</code></li><li><code>https://celestia-t-api.noders.services</code></li><li><code>http://celestiam.rest.lava.build</code></li><li><code>https://api-celestia-testnet.mzonder.com:443</code></li><li><code>https://celestia-testnet-da-archival.rpc.grove.city/v1/c33eeadb</code></li></ul><h2 id="community-grpc-endpoints" tabindex="-1">Community gRPC endpoints <a class="header-anchor" href="#community-grpc-endpoints" aria-label="Permalink to &quot;Community gRPC endpoints&quot;">​</a></h2><p>The gRPC endpoint is to allow users to interact with a Celestia Node using gRPC, a modern open-source and high-performance RPC framework. The default port is 9090. In the Cosmos SDK, gRPC is used to define state queries and broadcast transactions.</p><ul><li><code>public-celestia-mocha4-consensus.numia.xyz:9090</code></li><li><code>grpc-mocha.pops.one</code></li><li><code>grpc.celestia-mocha.com:443</code></li><li><code>full.consensus.mocha-4.celestia-mocha.com:9090</code></li><li><code>consensus-full-mocha-4.celestia-mocha.com:9090</code></li><li><code>celestia-testnet.brightlystake.com:9390</code></li><li><code>grpc-celestia-mocha.trusted-point.com:9099</code></li><li><code>grpc-celestia-testnet-01.stakeflow.io:16002</code></li><li><code>mocha.grpc.cumulo.me:443</code></li><li><code>grpc.archive.mocha.cumulo.com.es:443</code></li><li><code>grpc-1.testnet.celestia.nodes.guru:10790</code></li><li><code>grpc-2.testnet.celestia.nodes.guru:10790</code></li><li><code>celestia-testnet-grpc.itrocket.net:443</code></li><li><code>celestia-t-grpc.noders.services:21090</code></li><li><code>celestiam.grpc.lava.build:443</code></li><li><code>grpc-celestia-testnet.mzonder.com:443</code></li></ul><h2 id="community-json-rpc-endpoints" tabindex="-1">Community JSON-RPC Endpoints <a class="header-anchor" href="#community-json-rpc-endpoints" aria-label="Permalink to &quot;Community JSON-RPC Endpoints&quot;">​</a></h2><ul><li><code>celestiam.jsonrpc.lava.build</code></li><li><code>celestia-testnet-da-archival.rpc.grove.city/v1/c33eeadb</code></li></ul><h2 id="community-tendermint-rpc-endpoints" tabindex="-1">Community Tendermint RPC Endpoints <a class="header-anchor" href="#community-tendermint-rpc-endpoints" aria-label="Permalink to &quot;Community Tendermint RPC Endpoints&quot;">​</a></h2><ul><li><code>celestiam.tendermintrpc.lava.build</code></li></ul><h2 id="community-bridge-and-full-node-endpoints" tabindex="-1">Community bridge and full node endpoints <a class="header-anchor" href="#community-bridge-and-full-node-endpoints" aria-label="Permalink to &quot;Community bridge and full node endpoints&quot;">​</a></h2><p>The endpoints below are for bridge and full nodes only. They can be used to find bootstrapper peers in the p2p network.</p><p>Bridge node 1:</p><ul><li>da-bridge-mocha-4.celestia-mocha.com</li><li>bridge-mocha-4.da.celestia-mocha.com</li></ul><p>Bridge node 2:</p><ul><li>da-bridge-mocha-4-2.celestia-mocha.com</li><li>bridge-mocha-4-2.da.celestia-mocha.com</li></ul><p>Full node 1:</p><ul><li>da-full-1-mocha-4.celestia-mocha.com</li><li>full-1-mocha-4.da.celestia-mocha.com</li></ul><p>Full node 2:</p><ul><li>da-full-2-mocha-4.celestia-mocha.com</li><li>full-2-mocha-4.da.celestia-mocha.com</li><li>celestia-testnet-da-full-storage.mzonder.com <ul><li>RPC port: 27758</li><li>Gateway port: 27759</li></ul></li></ul><h2 id="mocha-testnet-faucet" tabindex="-1">Mocha testnet faucet <a class="header-anchor" href="#mocha-testnet-faucet" aria-label="Permalink to &quot;Mocha testnet faucet&quot;">​</a></h2><div class="danger custom-block"><p class="custom-block-title">WARNING</p><p>USING THIS FAUCET DOES NOT ENTITLE YOU TO ANY AIRDROP OR OTHER DISTRIBUTION OF MAINNET CELESTIA TOKENS. THERE ARE NO PUBLIC SALES OF ANY MAINNET CELESTIA TOKENS.</p></div><p>You can request from Mocha testnet Faucet on the #mocha-faucet channel on Celestia&#39;s Discord server with the following command:</p><div class="language-text vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">text</span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">$request &lt;CELESTIA-ADDRESS&gt;</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">$request &lt;CELESTIA-ADDRESS&gt;</span></span></code></pre></div><p>Where <code>&lt;CELESTIA-ADDRESS&gt;</code> is a <code>celestia1******</code> generated address.</p><div class="tip custom-block"><p class="custom-block-title">NOTE</p><p>Faucet has a limit of 10 tokens per week per address/Discord ID.</p></div><h2 id="analytics" tabindex="-1">Analytics <a class="header-anchor" href="#analytics" aria-label="Permalink to &quot;Analytics&quot;">​</a></h2><p>The following websites provide analytics for Mocha Testnet:</p><ul><li><a href="https://cosmoslist.co/testnet/celestia" target="_blank" rel="noreferrer">https://cosmoslist.co/testnet/celestia</a></li></ul><h2 id="explorers" tabindex="-1">Explorers <a class="header-anchor" href="#explorers" aria-label="Permalink to &quot;Explorers&quot;">​</a></h2><p>There are several explorers you can use for Mocha:</p><ul><li><code>https://mintscan.io/celestia-testnet/</code></li><li><code>https://mocha.celenium.io</code></li><li><code>https://explorer.nodestake.top/celestia-testnet/</code></li><li><code>https://stakeflow.io/celestia-testnet</code></li><li><code>https://testnet.celestia.explorers.guru</code></li><li><code>https://testnet.itrocket.net/celestia</code></li><li><code>https://testnet.celestia.valopers.com/</code></li></ul><h2 id="network-upgrades" tabindex="-1">Network upgrades <a class="header-anchor" href="#network-upgrades" aria-label="Permalink to &quot;Network upgrades&quot;">​</a></h2><p>There are a few ways to stay informed about network upgrades on the Mocha testnet:</p><ul><li>Telegram <a href="https://t.me/+smSFIA7XXLU4MjJh" target="_blank" rel="noreferrer">announcement channel</a></li><li>Discord <a href="https://discord.com/channels/638338779505229824/979037494735691816" target="_blank" rel="noreferrer">Mocha announcements</a></li></ul><p>See the <a href="/docs-preview/pr-1963/how-to-guides/network-upgrade-process">network upgrade process page</a> to learn more about specific upgrades like the <a href="/docs-preview/pr-1963/how-to-guides/network-upgrade-process#ginger-network-upgrade">Ginger network upgrade</a>.</p>',50),F=JSON.parse('{"title":"Mocha testnet","description":"Learn how to connect to the Mocha network.","frontmatter":{"description":"Learn how to connect to the Mocha network.","head":[["meta",{"property":"og:title","content":"Mocha testnet | Celestia Docs"}],["meta",{"property":"og:description","content":"Learn how to connect to the Mocha network."}]]},"headers":[],"relativePath":"how-to-guides/mocha-testnet.md","filePath":"how-to-guides/mocha-testnet.md","lastUpdated":1743433842000}'),D={name:"how-to-guides/mocha-testnet.md"},O=Object.assign(D,{setup(c){return(l,r)=>(i(),s("div",null,[R,a(T),q,a(d),A]))}});export{F as __pageData,O as default};
